INSERT INTO `producto` VALUES ('AEL318','Samsung Modelo UN60J6300AFXZX Televisión (LED Smart TV Full HD 60\")','Pantalla LED de 60 pulgadas con Full High Definition y funcionalidad de Smart TV, audio de 5.1 canales y auto nivelador de volumen.','Samsung',4),('AJX881','HP 12CP Financial Calculator','HP 12c Platinum is a faster, enhanced version of the industry-leading 12c calculator designed for the financial professional who demands more. Enjoy both RPN and Algebraic modes of entry, keystroke programming with four times more memory for up to 400 steps and more-than 130 built-in functions. There are now advanced editing features like the new \"Undo\" and \"Backspace\" buttons. Plus six times faster speeds for calculating TVM, loan payments, interest rates, standard deviation and more. Work more efficiently with memory for up to 80 cash flows. Ideal for real estate, finance, accounting, economics and business work. The easy-to-use layout and stylish look with metal back plate suitable for engraving make it a welcome addition to any desktop or a great gift idea. Permitted for use on the CFP and CFA Certification Exams, and GARP FRM Exam. You also get the reassurance of award-winning HP support available to you 24-hours a day, as well as an enhanced website with tutorials, educational resources and downloads.','HP',18),('BGV197','Kindle Paperwhite, pantalla E-ink de alta resolución, luz integrada, Wi-Fi','El nuevo Kindle Paperwhite introduce nuestra fuente más legible, Bookerly. Diseñada de cero, Bookerly ofrece un aspecto más elegante, ligero y mucho más cerca de la impresión tradicional que la de pantallas digitales, lo cual mejora la legibilidad especialmente durante largas sesiones de lectura. ','Amazon',10),('BQQ153','Celular Motorola Moto E Segunda 2da LTE 8GB','El Motorola Moto E posee una fabulosa cámara integrada de 5 megapíxeles, podrás capturar tus momentos favoritos de una manera fácil y perfecta gracias a la tecnología de su potente lente, que además te permite grabar videos en 720p HD.','Motorola',11),('DCH919','GoPro HERO4 Session Negra Videocámara (CHDHS-101)','La HERO4 Session almacena toda la potencia de GoPro en una cámara más pequeña, ligera y práctica. Cuenta con un diseño resistente y sumergible, control fácil mediante un botón, vídeo de 1080p60 y fotos de 8 MP. Captura vídeo nítido y real en alta resolución de 1440p30 y 1080p60. El vídeo con velocidades de fotograma de 720p100 ofrece una reproducción a cámara lenta excepcional y fluida de todos los momentos destacados.','GoPro',16),('DFL422','Canon EOS 70D Cámara Digital SLR con Lente STM de 18 - 135 mm','La cámara digital SLR 8469B016 EOS 70 D de 20.2 MP de Canon, además del lente EF-S con acercamiento estándar de 18-135mm IS STM tienen un sensor CMOS APS-C y procesador de imagen DIGIC 5+ para asegurar una alta resolución de las imágenes y una excelente sensibilidad a la luz escaza. Ambos, el sensor y el procesador trabajan juntos para producir las imágenes con los mejores detalles y la mayor claridad para exhibir las tonalidades naturales y la escala de colores con el menor ruido cuando se trabaja en condiciones de difícil iluminación. El procesador también ofrece un velocidad notable en todo el sistema de la cámara, que incluye la habilidad de grabar más de 7 cuadros por segundo en la mayor resolución, rápida velocidad de auto enfoque y grabación de video en alta definición fr 1080 p. La pantalla táctil LCD ClearView II de 3\" aprovecha al máximo el sistema de enfoque automático Dual Pixel CMOS y su capacidad utilizar enfoque automático táctil para una selección altamente controlada del punto de enfoque. El diseño con ángulo variable de la pantalla permite tomar fotografías y verlas desde ángulos altos o bajos, y la protección antirreflejo resistente a manchas permite una vista clara y detallada. El lente de acercamiento estándar IS STM de 18 - 135 mm incluido cuenta con un sistema de estabilización de imagen refinado que proporciona más de cuatro escalas equivalentes a la corrección de la vibración a través del rango de acercamiento y ofrece un acercamiento máximo de 9.28 x al final del teleobjetivo.','Canon',15),('DSZ305','Tech Pad WIN 816','Esta notebook HP presenta la combinación perfecta de diseño, confiabilidad y recursos. Estilo y productividad, al tiempo que piensas en tu presupuesto, algo que te encantará. Windows 10 Home u otros sistemas operativos disponibles Características adecuadas, precio adecuado Almacenamiento y alimentación fiables para una relación calidad precio insuperable. image Alto rendimiento Los procesadores Intel® CoreTM I5 ofrecen rendimiento de primer nivel. Con procesadores de dos núcleos, disfrutará de imágenes asombrosas, tareas simultáneas sin esfuerzo, más velocidad y mejor seguridad, todo lo cual lo ayudará a crear, jugar, entretener y cumplir objetivos. Potencia de procesamiento confiable Con procesadores líderes en la industria, obtenga el rendimiento confiable que espera y calidad en la que puede confiar. Pantalla de alta definición Disfrute de su entretenimiento con una claridad impresionante gracias a esta pantalla HD nítida. Audio DTS Sound+ Disfrute de matices de audio dinámicos y sonidos de calidad con DTS Sound +. Gráficos asombrosos Disfrute de películas, juegos y mucho más con gráficos Intel®. Cámara web HP TrueVision HD Capture todos los detalles con gran claridad, incluso en situaciones de poca luz. Repleta de puertos Conéctese con facilidad. Unidad de DVD regrabable Mire películas en DVD.7 O grabe sus propios discos. Diseño elegante Lleve este notebook a cualquier parte, gracias a su diseño delgado y liviano. Windows 10 Home u otros sistemas operativos disponibles','Patito',2),('EMA401','TomTom Via 1500 Series Navegador GPS portátil','The VIA 1505 M is perfect for anyone who wants easy-to-use, intuitive navigation. It also comes with Free Lifetime Map Updates, so your maps change when the roads do, for the life of your VIA. Every device in this series includes our TomTom Maps with IQ Routes and Map Share technology. These devices keep you up-to-date with dynamic road changes on a daily basis, with maps that cover the US, Canada and Mexico.','TomTom',6),('EMF771','Audifonos Originales Headphones HTC 3.5mm','Traemos para ti este practico Cargador Inalámbrico para Samsung Galaxy S5, S6, S6 Edge, Note 4 o Note 5, su diseño liviano simplifica su traslado ya que es de poco espacio, lo puedes llevar con facilidad a todas partes, contamos con dos colores: blanco y negro según tu elección, además de su diseño único , protege tu dispositivo de sobrecargas, ya no tendras que quedarte sin batería , con este cargador ten tu dispositivo siempre listo para usarse , donde quiera que estes, no te quedes son él .','Chicaspekes',12),('ERZ479','Nikon Coolpix L840 High Zoom Cámara','A 38x optical zoom telephoto lens with Vibration Reduction, a low-light 16MP CMOS image sensor and built-in Wi-Fi and Near Field Communication technology (NFC; NFC feature for Android v 4.0 or later smart devices only) all come together to help you take and share amazing photos and Full HD 1080p videos. Flip out the tilting LCD screen and take a low-angle macro shot of something right in front of you, then zoom in and catch a detailed close-up of something far in the distance. Start sharing extraordinary views of your life.','Nikon',14),('ETI607','HP ProBook K4L00UT','Take on tasks in the office or on the road with a durable HP Rebook 650. These Rebooks are thin, light and packed with productivity features to make work faster and easier. Plus, reliable security solutions keep your data out of the wrong hands.','HP',1),('FKN888','Computadora HP Z400 Work Station','Profesional Workstation con procesador quad core y tarjeta grafica Nvidia Gforce dedicada de 1gb de video','HP',3),('FLE903','Warner Bros Batman: Arkham Knight, PS4 - Standard Edition','Dimensiones del producto: 13.5 x 1.5 x 17 cm ; 113 g','Warner Bros',9),('FMG475','Casio FC200V calculator - Calculadora (Pocket, Financial, Black, 80 x 161 x 1244)','Casio Calculadora Financiera','Casio',18),('HCQ600','Aluratek Audífonos Inalámbricos con Bluetooth - Empaque de Fábrica - Negro','Aluratek ABH04FB Auriculares estéreo inalámbricos con Bluetooth ABH04FB Auriculares & Audífonos','Aluratek ',5),('HIJ443','Panasonic VIERA TC-32AS600X- Televisión LED 32\"','Panasonic TC-32AS600X Televisor LED720p HDTV, 32\"','Panasonic',4),('HMM123','Toshiba Excite Go AT7-C8','Tablet fun for less than you might think. Meet the Excite Go™ tablet, a 7-inch device that fits comfortably in the palm of your hand (and your budget). Powered by the latest Android™ 4.4, KitKat and Intel processor, it delivers plenty of performance for all the movies, books, apps and games you love—all on a clear multi-finger touchscreen. So you can browse effortlessly, multitask and enjoy tons of apps for endless fun. Packed with easy-to-use features and backed by proven Toshiba quality, this compact tablet offers a robust, reliable Android™ experience—at a fraction of what others cost.','Toshiba',2),('HQJ896','Canon PowerShot SX60 HS Cámara digital','Con la cámara digital Power Shot SX60 HS de Canon harás acercamientos como nunca antes para ver los cráteres de la luna, la vida silvestre desde lejos y el rostro de tus niños en un escenario escolar abarrotado. La Power Shot SX60 HS te ofrece un alcance para capturar todo. El extraordinario acercamiento óptico gran angular de 65 x de la cámara con estabilizador óptico de la imagen combinan una flexibilidad estupenda con facilidad de transporte. El sensor CMOS de alta sensibilidad de 16.1 megapíxeles junto con el procesador de imagen DIGIC 6 crean el sistema Canon HS para un excelente rendimiento en poca luz. La tecnología avanzada incluye un asistente de encuadre de acercamiento y el estabilizador de imagen inteligente te ayuda a seguir y a capturar tomas claras y firmes a larga distancia. Grabación de videos en alta definición real de 1080 p a 60 p. Las tecnologías USM y VCM ayudan a asegurar un enfoque y un acercamiento rápido y silencioso durante la grabación y, por primera vez en un modelo PowerShot, puedes conectar un micrófono externo opcional. Comparta rápidamente todo lo que captures. La PowerShot SX60 HS está habilitada con Wi-Fi y comunicación de campo cercano , mediante un conveniente botón de conexión a dispositivos móviles.','Canon',14),('HXI778','Adaptador de corriente Amazon PowerFast (compatible con todos los dispositivos Amazon)','Los e-readers se cargan a la misma velocidad, ya sea se utilice un cargador de 5W o de 9W para hacerlo.','Amazon',10),('IEF542','Smartwatch D360','We only use Singapore post for this products . Otherwise the order can not be accepted . Thank you for your kindly cooperation.','OEM',13),('IFA921','Samsung Galaxy Grand Prime Duos GT-SM G531 Dual Sim-Dorado','Disfruta de todos los beneficios de la tecnología Samsung. Obtén gráficos increíbles, rendimiento superior, funcionalidad versátil y una infinidad de posibilidades con el Samsung Galaxy Grand Prime. Compacto y portable, este dispositivo encierra gran poder y capacidad que simplificará tu día, ya sea que quieras usarlo para el entretenimiento o el trabajo, el Samsung Galaxy Grand Prime es un equipo que querrás tener siempre contigo','Samsung',11),('IHV263','Street Fighter V - PlayStation 4 - Standard Edition','La franquicia de lucha legendaria vuelve con Street Fighter V ! Desarrollado por la tecnología Unreal Engine 4 , impresionantes efectos visuales representan la próxima generación de guerreros del Mundo en un detalle sin precedentes , mientras emocionantes y accesibles mecánica de batalla entregan interminable diversión de lucha que los ','Capcom',9),('IOC339','Tony Hawk World 2015 - Xbox 360 - Standard Edition','Dimensiones del producto: 13.5 x 1.5 x 19 cm ; 200 g','Activision',8),('IPJ100','Nikon D4s (Solamente Cuerpo de Cámara) DSLR Cámara FX DSLR','La evolución de una obra maestra El curso de las imágenes modernas ha sido forjado por el talento y el ingenio de los profesionales que trabajan en ello pero también con la introducción de unas cuantas cámaras, tan innovadoras y adelantadas para la época que redefinen lo que es posible La Nikon D4 ha sido una de estas cámaras Y ahora la D4s es la prueba de como algo tan genial puede mejorarse aún más, con uns arreglos extraordinarios para todo la dinámica de funcionamiento, deslumbrantes niveles de velocidad, desempeño, sensibilidad ISO, y por supuesto, la calidad de imagen superior de cualquier cámara Nikon Velocidad y desempeño, como hacer de una cámara revolucionaria algo aún mejor? Mejora la velocidad, precisión su eficiencia sin sacrificar las características que la convierten en algo excepcional. La D4S se construye basándose en el éxito de la D4 con un procesamiento de imagen 30% más rápido, energía de captura substancial de 3,020 cuadros fijos en una sola carga individual extendida de rango ISO con reducción de sonido mejorada y arreglos en el rango de tono y graduaciones más suaves. ','Nikon',15),('ISK552','Bose SoundLink Auriculares II, circumaurales, inalámbricos, negros','Enjoy a better wireless experience with Bose Sound Link around-ear wireless headphones II. Exclusive technology delivers deep, immersive sound at any volume, making them the best-sounding wireless headphones available. A dual microphone system rejects noise and wind so youll be heard loud and clear. And enhanced side tone makes your voice sound more natural. Sound Link wireless headphones use the latest Bluetooth technology so you can easily connect to your mobile devices with seamless audio/video sync and switch between two devices. For NFC-enabled devices, you can simply tap the right ear cup for quick pairing. A rechargeable lithium-ion battery lets you listen for up to 15 hours and gives you up to 2 hours of play time with a 15-minute charge. Effortless touch controls allow for simple command of your music and calls. And voice prompts give you information about battery life, device connection and caller ID. Sound Link wireless headphones are lighter and more comfortable than other comparable wireless headphones so you can enjoy them all day long. Wear them almost anywhere, and experience uncompromised wireless performance. Included: Sound Link around-ear headphones; detachable audio cable; carrying case.','Bose',5),('JCS069','PHONECT ELEPHONE ELE Explorer WIFI Aliwinner V3 2.0 Pulgadas TFT LCD 4K 16MP Cámara Impermeable de Acción Deporte con Lente de 170°Gran Angular','Claridad de vídeo: 4K (3840 * 2160) 15FPS, 2.7K (2688 * 1520) 30FPS, 1080P (1920 x 1080) 60FPS / 30FPS, 720P (1280 * 720) 120FPS / 60FPS / 30FPS ','ELEPHONE',16),('JIG535','Fujifilm X-A1 Kit Camara XC 16-50mm','Fujifilm X-A1 Kit Cámara XC 16-50mm','Fujifilm',14),('JRP371','HP Laptop 15-G213LA','HP Laptop 15-G213LA AMD A6-5200 4GB 1TB DVD 15.6\" Win.8.1+ Maletin Gris','HP',1),('JTJ597','Sony KDL-40R480B - Televisión LED 40\" ','40\" Led Wifi Smart Sony Kdl40R480B','Sony',4),('JTM602','Garmin Zumo 390LM 4.3-Inch Motorcycle GPS Navigator','zumo 390LM tiene una amplia pantalla táctil de 4,3\" de fácil lectura, aún bajo la luz del sol. Su interfaz intuitiva apta para uso con guantes permite que el ingreso de información sea tan fácil como realizar un cambio de marcha. Con resistente carcasa a prueba de agua hasta IPX7¹ y resistente al rocío con combustible y a los rayos UV, el zumo 390LM está hecho para la carretera.','Garmin',6),('KAE524','Dark Souls II - Xbox 360','Developed by From Software, Dark Souls II is the highly anticipated sequel to the punishing 2011 breakout hit Dark Souls (9.5/10 GameSpot, 9.0/10 IGN). The unique old-school action RPG experience captivated imaginations of gamers worldwide with incredible challenge and intense emotional reward. Dark Souls II brings the franchise’s renowned difficulty & gripping gameplay innovations to both single and multiplayer experiences.','Namco',8),('KDV031','HP OfficeJet PRO 8610- Impresora multifunción de tinta a color (escáner, fax, copiadora, WiFi) B1H Option','Funciones: Impresión, copia, escaneo, envío de fax, web. Especificaciones de impresión. Velocidad de impresión en negro hasta 19 Ppm; borrador: Hasta 31 Ppm. Velocidad de impresión a color Iso. Hasta 14,5 Ppm; borrador hasta 31 Ppm. Primera página impresa (Lista) negro: Velocidad máxima de 12 segundos / 13 Segundos. Ciclo de trabajo (mensual, a4), hasta 30.000 Paginas. Volumen de paginas mensual. Recomendado: 250 A 1500 paginas. Tecnología de impresión: Inyección térmica de tinta Hp. Calidad de impresión (optima). Hasta 4800 X 1200 Dpi optimizados en papel fotográfico Hp Advanced a partir de 1200 X 1200 Dpi de entrada negro.','HP',17),('KTM383','Funda de piel Amazon para Kindle Paperwhite, color negro ónix (sólo sirve para Kindle Paperwhite 5ª, 6ª, y 7ª generaciones)','Nuestra funda protectora de piel está diseñada para ser la funda más ligera y delgada para Kindle Paperwhite. Resulta de la fusión de la piel texturizada de la más alta calidad y de un interior adaptable que protege tu Kindle Paperwhite sin necesidad de correas ni bisagras.','Amazon',10),('KYE377','Lenovo 57327814','La pantalla de 19,5” ocupa muy poco espacio en tu escritorio, mostrador o centro de entretenimiento, y se ve extraordinaria con una terminación que puedes elegir en blanco brillante o negro azabache. La unidad tiene sólo 155 mm de profundidad y te ayuda a no tener todos los cables desordenados. Todo queda perfectamente acomodado cuando nadie está usando la C260, aunque es muy poco probable que no quieran utilizarla.','Lenovo',3),('LHE842','ASUS ME181 MeMO Pad 8','Procesador: Core i5-5200U. 5th Generation. (3M Cache, up to 2.70 GHz) ,Memoria RAM: 4GB DDR3L 1600MHz ,Disco Duro: 1TB 5400 rpm SATA Hard Drive ,Pantalla: 14\' HD (1366 x 768) con Truelife ,Tarjeta de Gràficos: Gráficos Intel HD 5500 ,Webcam: HD Webcam ,Lector de Tarjetas : Lector de Medios 8 en 1, Ethernet RJ45 y HDMI™ v1.4a ,Sistema Operartivo: Windows 8.1 (64 Bit), Español ,Optico: 8X DVD+/-RW ,WIFI: Dual Band Wireless AC 3160 ,Tarjeta de Red: 0 ,Bluetooth: Bluetooth 4.0 ,Modem: No Modem Option ,Video y Audio : Waves MaxxAudio ,Conectividad y expansión : 0 ,Puertos USB: HDMI™ v1.4a ,Puerto HDMI: (2) USB 3.0, (1) USB 2.0 ,Dimensiones: 34.2 x 24.6 x 2.16 cm ,Peso : 2.02 kg ,Garantía : 1 año de garantía Estándar ,Varios: 0 ,CONSUMO DE ENERGIA : 0 ,Bundle: 0 ,Bocinas: Integrado ,Mouse: Integrado ,Teclado: Teclado Iluminado en Español','Asus',2),('LHG890','Consola PlayStation 4 de 500GB + God of War 3 Remastered - Bundle Edition','\"La PS4 permite a los mejores desarrolladores de videojuegos del mundo dar rienda suelta a su creatividad y extender las fronteras del juego mediante un sistema ajustado especialmente a sus necesidades. La consola PlayStation 4 con capacidad de 500 GB de disco duro y un nuevo control, el Dual Shock 4 es la combinación perfecta para los gamers más exigentes. Ten la mejor experiencia de juego gracias a sus graficas súper avanzadas, velocidad única, personalización inteligente, redes sociales integradas y capacidad para una segunda pantalla. Las mejores aplicaciones y videojuegos exclusivos, el PlayStation 4 tiene todo lo que un jugador necesita para pasar horas increíbles de entretenimiento.\"','Sony Computer Entertainment',9),('MDW464','Texas Instruments TI BA II Plus Professional - Calculadora (Pocket, Financial, Black, Silver, Buttons, Battery, CR2032)','Handles both common math and various financial functions','Texas Instruments',18),('MMP504','Nikon D5500 18 - 55mm f/3 5 -5.6 G VR II DSLR Cámara DX DSLR','Get more creative than ever. Flip out the touchscreen Vari-angle display, find an exciting new perspective and capture it as an ultra-sharp 24.2-megapixel photo. Flick a switch and start recording Full HD 1080 video at a high-speed frame rate of 60p, which is great for fast action and ultra-smooth slow motion. Break free of the ordinary with artistic filters and effects, built-in HDR capabilities, time lapse photography, outstanding low-light capabilities and much more. You wont even have to wait to share your creations built-in Wi-Fi means you can share your images anywhere, anytime.','Nikon',15),('MNK427','martphone Samsung Galaxy S6 Edge Plus 32GB','Samsung presentan el smartphone Samsung Galaxy S6 Edge, un dispositivo diseñado para lograr el máximo entretenimiento y eficiencia en el trabajo, ya que cuenta con el tamaño ideal para llevarlo en tu bolsa y todo el poder para correr tus aplicaciones favoritas. Está equipada con un procesador Quad Core a 1.5ghz, una memoria RAM de 3Gb y el sistema operativo Android 5.02 Lollipop. Por si fuera poco cuenta con una excelente cámara, conectividad wifi y la capacidad para ampliar su memoria interna vía memoria SD.','Samsung',11),('MPE082','Bluedio Auricular Bluedio N2 Sports Bluetooth V4.1 In-Ear Earphone','Bluedio N2: El sonido de la naturaleza impactante Profundamente Soul Blanco   Tómese unos momentos para navegar a este par de Bluedio N2 inalámbricos Bluetooth manos libres estéreo para auriculares in-ear. Le proporciona una sensación de experiencia auditiva tranquilo y confortable. Especialmente diseñado con estilo en la oreja, Bluedio N2 le da comodidad y ajuste final. Caracterizado por un diseño elegante y tecnología avanzada, que le permitirá ser fresco y de moda una vez que lo lleva.','Bluedio',12),('MSM458','Dell NB Inspiron 5458 14\"','Procesador: Core i5-5200U. 5th Generation. (3M Cache, up to 2.70 GHz) ,Memoria RAM: 4GB DDR3L 1600MHz ,Disco Duro: 1TB 5400 rpm SATA Hard Drive ,Pantalla: 14\' HD (1366 x 768) con Truelife ,Tarjeta de Gràficos: Gráficos Intel HD 5500 ,Webcam: HD Webcam ,Lector de Tarjetas : Lector de Medios 8 en 1, Ethernet RJ45 y HDMI™ v1.4a ,Sistema Operartivo: Windows 8.1 (64 Bit), Español ,Optico: 8X DVD+/-RW ,WIFI: Dual Band Wireless AC 3160 ,Tarjeta de Red: 0 ,Bluetooth: Bluetooth 4.0 ,Modem: No Modem Option ,Video y Audio : Waves MaxxAudio ,Conectividad y expansión : 0 ,Puertos USB: HDMI™ v1.4a ,Puerto HDMI: (2) USB 3.0, (1) USB 2.0 ,Dimensiones: 34.2 x 24.6 x 2.16 cm ,Peso : 2.02 kg ,Garantía : 1 año de garantía Estándar ,Varios: 0 ,CONSUMO DE ENERGIA : 0 ,Bundle: 0 ,Bocinas: Integrado ,Mouse: Integrado ,Teclado: Teclado Iluminado en Español','Dell',1),('NES580','Naruto Shippuden: Ultimate Ninja Storm 4 - PlayStation 4 - Standard Edition','Con más de 12 millones de Naruto Shippuden : juegos TORMENTA último Ninja venden en todo el mundo , esta serie se estableció entre el pináculo de Anime adaptaciones de videojuegos ! Como toda buena historia llega a su fin, Naruto Shippuden : Ultimate Ninja STORM 4 va a ser el juego TORMENTA más increíble lanzado hasta la fecha ! Jugadores de todo el mundo podrán experimentar las aventuras emocionantes de Naruto Uzumaki como nunca antes! La última obra de la serie STORM aclamado llevará a los jugadores en un viaje espectacular y épica con nuevas características como el sistema de cambio Líder y Wall - plazo. Por primera vez en la historia , el mundo de NARUTO también aprovechará la potencia gráfica de los sistemas de nueva generación. Esto es sólo el principio y más personajes y características se darán a conocer en el futuro!','Bandai Namco',9),('NGO780','Samsung UN-32J4300 - Televisión LED 32\"','Samsung UN40H5103AFXZX Televisor LED 40\" Smart TV, FHD 1920 X 1080, 120 Hz','Samsung',4),('NTB420','Nikon D7100 (Solamente Cuerpo de Cámara) DSLR Cámara DX DSLR','Sensor de imagen formato DX de 24.1 toma de 6 cuadros por segundo hasta 100 tomas de forma continua. Intercambio inalámbrico y control con adaptador WU-1a Rango ISO de 100 a 6400, grabación de videos 1080p con enfoque automático a tiempo completo y micrófono estéreo incorporado.','Nikon',15),('OLK908','Resident Evil 6 - Xbox 360 - Standard Edition','Han pasado ya diez años desde aquel terrible incidente ocurrido en Racoon City. Tal suceso provocó una serie de eventos catastróficos biológicamente a nivel internacional. Varios agentes han frenado con éxito a sombrías corporaciones que han intentado crear sus propias armas biológicas con fines de conquista global. Pese a estos importantes logros, estos casos han aumentado de manera alarmante en todos los continentes. La situación ha obligado al presidente de los Estados Unidos a brindar un comunicado especial, en un intento desesperado por frenar estos actos terroristas. Sin embargo, este suceso que debiera detener eficazmente los macabros acontecimientos, ha detonado el terror mundial. El juego tiene dos enemigos principales, incluyendo a los zombis que regresan a la franquicia después de varias entregas sin incluirlos y el recientemente introducido Javo. A diferencia de los zombis, los Javos son capaces de interactuar entre sí para planear ataques estratégicos y emboscadas, también contarán con la inteligencia suficiente para usar armas de fuego y curarse entre ellos.','Capcom',8),('OOV741','Nikon Coolpix P900 High Zoom','Change the way you see, capture and share the world with the most powerful zoom lens ever put into a Nikon COOLPIX camera: an 83x optical zoom/166x Dynamic Fine Zoom (an enhanced digital zoom function that effectively doubles your reach) super telephoto lens with Dual Detect Optical VR. A low-light 16 MP CMOS image sensor captures the finest details, then with the cameras built-in Wi-Fi and Near Field Communication technology (NFC; NFC feature for Android v 4.0 or later smart devices only), you can wirelessly share photos to a compatible smartphone. Compose shots with the swiveling Vari-Angle display or the high-resolution eye-level viewfinder (EVF). Built-in GPS, full manual control for those who want it, point-and-shoot ease for those who dont, and much more.','Nikon',14),('OXT900','ikon Coolpix J5 Nikon 1 Cámara Compacta Digital','Capture in 20.8-megapixels of dazzling resolution. The Nikon 1 J5s all new back-side illuminated (BSI) CX-format CMOS image sensor gathers more light than a traditional CMOS sensor, enabling faster shutter speeds and enhanced low-light 